import WebCanvas from './webCanvasss';     //引入  webview中html的代码
const base64= 'data:image/png;base64,'; // 随便写个base64地址，
const url = 'https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1543467396820&di=860361930cb9d25c5a0ae9446b5e3621&imgtype=0&src=http%3A%2F%2Fww2.sinaimg.cn%2Fmw600%2F7d32a1ccgw1e4z818r4wjj20go0brmxe.jpg';
const { width, height } = Dimensions.get("window");
export default class ValentinesDay extends Component {
    constructor(props) {
        super(props);
        this.state = {
            scrollEnabled: true,  //判断画笔和橡皮擦
            modal: false
        }
    }
    _pen() {
        this.setState({
            scrollEnabled: true
        })
        this.refs.canvas._pen();
    }
    _clean() {
        this.setState({
            scrollEnabled: false
        })
        this.refs.canvas._clean();
    }
    _init() {
        this.refs.canvas._init(url);
    }
    // 以url的形式添加背景
    _addImageUrl() {
        this.refs.canvas._addImageUrl(url);
    }
    // 以base64的形式添加背景
    _addImageBase64() {
        this.refs.canvas._addImageBase64(base64);
    }
    // 得到图片的base64形式
    _getBase64() {
        this.refs.canvas._getBase64(base64);
    }
    // 保存base64
    _handleBase64(data) {
        // console.log(data)
        this.props.navigator.push({
            component: ValentinesDaySub,
            params: {
                navigator: this.props.navigator,
                canvasUrl: data,
                new:this.props.new
            }
        })
    }
    // 图片右转
    _rotateRight() {
        this.refs.canvas._rotateRight();
    }
    render() {
        return (
            <View style={styles.container}>
                    <View style={styles.canvasViewImage}>
                            <View style={styles.canvasStart}>
                                <WebCanvas
                                    handleBase64={this._handleBase64.bind(this)}
                                    ref='canvas'
                                    bgurl={url}
                                    width={250}
                                    height={280}
                                />
                            </View>
                    </View>
                <View style={{ position: "absolute", bottom: 20, right: 50, flexDirection: "row" }}>
                    <TouchableOpacity onPress={this._pen.bind(this)}>
                        <Text>笔</Text>
                    </TouchableOpacity>
                    <TouchableOpacity style={{ marginLeft: 10 }} onPress={this._addImageBase64.bind(this)}>
                        <Text>添加批注</Text>
                    </TouchableOpacity>
                    <TouchableOpacity style={{ marginLeft: 10 }} onPress={this._init.bind(this)}>
                        <Text>清除</Text>
                    </TouchableOpacity>
                </View>
                    {/* <TouchableOpacity onPress={this._rotateRight.bind(this)}>
            <Text>右转</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={this._addImageUrl.bind(this)}>
            <Text>url上传</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={this._addImageBase64.bind(this)}>
            <Text>Base64上传</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={this._getBase64.bind(this)}>
            <Text>保存图片</Text>
            </TouchableOpacity>
            <Image
            style={{ width:100,height:100 }}
            source={{uri: this.state.imageData, scale: 3}}
        /> */}
            </View>
        );
    }
}
